/**
 Custom DSP function implementation
 */
int spectrogram_eon_features(signal_t *signal, matrix_t *output_matrix, void *config_ptr, const float frequency) {
    ei_dsp_config_tflite_eon_t config = *((ei_dsp_config_tflite_eon_t*)config_ptr);

    // 1. we run our spectrogram block...
    ei_dsp_config_spectrogram_t spectrogram_cfg = {
        0, // uint32_t block_id;
        3, // uint16_t implementation_version;
        1, // int axes;
        0.01f, // float frame_length;
        0.005f, // float frame_stride;
        128, // int fft_length;
        -72, // int noise_floor_db;
        false // bool show_axes;
    };

    // calculate how much memory we need
    matrix_size_t out_matrix_size =
        speechpy::feature::calculate_mfe_buffer_size(
            signal->total_length, frequency, spectrogram_cfg.frame_length, spectrogram_cfg.frame_stride, spectrogram_cfg.fft_length / 2 + 1,
            spectrogram_cfg.implementation_version);

    // alloc some memory
    matrix_t spectrogram_features(out_matrix_size.rows, out_matrix_size.cols);

    // run DSP code
    int spectrogram_res = extract_spectrogram_features(signal, &spectrogram_features, (void*)&spectrogram_cfg, frequency);
    if (spectrogram_res != EIDSP_OK) {
        printf("Creating spectrogram failed (%d)\n", spectrogram_res);
        return spectrogram_res;
    }

    // create a new signal (this we'll pass in to the NN)
    signal_t dsp_signal;
    int signal_res = ei::numpy::signal_from_buffer((const float*)spectrogram_features.buffer,
        spectrogram_features.rows * spectrogram_features.cols, &dsp_signal);
    if (signal_res != EIDSP_OK) {
        printf("Creating signal failed (%d)\n", signal_res);
        return signal_res;
    }

    // 2. run the NN
    ei_config_tflite_eon_graph_t ei_config_tflite_graph = {
        .implementation_version = 1,
        .model_init = config.init_fn,
        .model_invoke = config.invoke_fn,
        .model_reset = config.reset_fn,
        .model_input = config.input_fn,
        .model_output = config.output_fn,
    };

    ei_learning_block_config_tflite_graph_t nn_config = {
        .implementation_version = 1,
        .block_id = config.block_id,
        .object_detection = false,
        .object_detection_last_layer = EI_CLASSIFIER_LAST_LAYER_UNKNOWN,
        .output_data_tensor = 0,
        .output_labels_tensor = 255,
        .output_score_tensor = 255,
        .quantized = 0,
        .compiled = 1,
        .graph_config = &ei_config_tflite_graph
    };

    auto x = run_nn_inference_from_dsp(&nn_config, &dsp_signal, output_matrix);
    if (x != 0) {
        return x;
    }

    return EIDSP_OK;
}

int main(int argc, char **argv) {

    signal_t signal;            // Wrapper for raw input buffer
    ei_impulse_result_t result; // Used to store inference output
    EI_IMPULSE_ERROR res;       // Return code from inference

    // Calculate the length of the buffer
    size_t buf_len = sizeof(features) / sizeof(features[0]);

    // Make sure that the length of the buffer matches expected input length
    if (buf_len != EI_CLASSIFIER_DSP_INPUT_FRAME_SIZE) {
        ei_printf("ERROR: The size of the input buffer is not correct.\r\n");
        ei_printf("Expected %d items, but got %d\r\n",
                EI_CLASSIFIER_DSP_INPUT_FRAME_SIZE,
                (int)buf_len);
        return 1;
    }

    // Assign callback function to fill buffer used for preprocessing/inference
    signal.total_length = EI_CLASSIFIER_DSP_INPUT_FRAME_SIZE;
    signal.get_data = &get_signal_data;

    // Perform DSP pre-processing and inference
    res = run_classifier(&signal, &result, false);

    // Print return code and how long it took to perform inference
    ei_printf("run_classifier returned: %d\r\n", res);
    ei_printf("Timing: DSP %d ms, inference %d ms, anomaly %d ms\r\n",
            result.timing.dsp,
            result.timing.classification,
            result.timing.anomaly);

    // Print the prediction results (object detection)
#if EI_CLASSIFIER_OBJECT_DETECTION == 1
    ei_printf("Object detection bounding boxes:\r\n");
    for (uint32_t i = 0; i < result.bounding_boxes_count; i++) {
        ei_impulse_result_bounding_box_t bb = result.bounding_boxes[i];
        if (bb.value == 0) {
            continue;
        }
        ei_printf("  %s (%f) [ x: %u, y: %u, width: %u, height: %u ]\r\n",
                bb.label,
                bb.value,
                bb.x,
                bb.y,
                bb.width,
                bb.height);
    }

    // Print the prediction results (classification)
#else
    ei_printf("Predictions:\r\n");
    for (uint16_t i = 0; i < EI_CLASSIFIER_LABEL_COUNT; i++) {
        ei_printf("  %s: ", ei_classifier_inferencing_categories[i]);
        ei_printf("%.5f\r\n", result.classification[i].value);
    }
#endif

    // Print anomaly result (if it exists)
#if EI_CLASSIFIER_HAS_ANOMALY == 1
    ei_printf("Anomaly prediction: %.3f\r\n", result.anomaly);
#endif

    return 0;
}

// Callback: fill a section of the out_ptr buffer when requested
static int get_signal_data(size_t offset, size_t length, float *out_ptr) {
    for (size_t i = 0; i < length; i++) {
        out_ptr[i] = (features + offset)[i];
    }

    return EIDSP_OK;
}
